    },
    {
        "id": 10,
        "name": "Jack",
        "age": 42,
        "phone": "555-8901",
        "email": "jack@example.com"
    }
]

const Users = () => {
    console.log(usersData);
    return (
        <div>
            {usersData.map((user) => (
                <div key={user.id}>
                    <p>Name: {user.name}</p>
                    <p>Age: {user.age}</p>
                </div>
            ))}
        </div>
    );
}

export default Users;
